import React from 'react'
import '../GofundNFT.css';
import 'bootstrap/dist/css/bootstrap.min.css';


import fundoDetalhe from "../images/fundoDetalhe.png";



function FundoDetalheImg(){
    return (
      <div  style={{ height:'1px'}} >       
            <img  style={{marginTop:'170px'}}             
                                src={fundoDetalhe} 
                                class="img-fluid"  
                                alt="FundoGoTokens"
                                
                                >
            </img>         
      </div>
        
    );
}

export default FundoDetalheImg;
